    render() {
        return (
            <nav>
                <ul>
                    <li><a href="/">Главная</a></li>
                    <li><a href="/points">Пункты обмена</a></li>
                    <li><a href="/about">О нас</a></li>
                </ul>
            </nav>
        );
    }
}

export default Nav;
